ng so that the  InfoWindow won't close when you click on the map.<\/li>\n<li><b>Test with Tabs<\/b>: Create an InfoWindow with two tabs.<\/li><li><b>Test maxContent<\/b>: Add a Maximized Title and Content to the InfoWindow<\/li>\n<li><b>Test Maximized with Widgets<\/b>: Instead of text, use widgetsfor the title and content when maximized.<\/li>\n<li><b>Test Map Blowup Info Window<\/b>: Display a Map Blowup inside an InfoWindow<\/li><\/ul>",rFb='<h5> See source in ',sMb='<html><body onload="if(parent.__gwt_onHistoryLoad)parent.__gwt_onHistoryLoad(__gwt_historyToken.innerText)"><div id="__gwt_historyToken">',UFb='<i>Maximized Italic Boots<\/i>',uNb="<iframe src=\"javascript:''\" name='",VOb="<img onload='this.__gwtLastUnhandledEvent=\"load\";' src='",KFb='<img src="boot.jpg" width="235" height="287">',MEb='<p> Creates a zoomed out map.<\/p><p>Clicking on one of the buttons below the map submits the  address to the Google Geocoding service.  When the query returns successfullythe map will display a marker on the coordinates and display the country code returned from the query in an InfoWindow.<\/p><p>Equivalent to the Maps JavaScript API Example: <a href="http://code.google.com/apis/maps/documentation/examples/geocoding-extraction.html">http://code.google.com/apis/maps/documentation/examples/geocoding-extraction.html<\/a><\/p>\n',oCb='<p><i>Description not provided.<\/i><\/p>\n<p>(Add an implementation of <code>getDescriptionHTML()<\/code> for this demo)<\/p>',GJb='<p>Creates 2 maps centered on Palo Alto, CA USA. You should be able to scroll the viewport by clicking and dragging with the mouse.<\/p>\n<p>The map window should be decorated with controls for zooming in and out and for changing the map type appropriate to the map size.<\/p><p>Use the checkboxes and the <i>Apply<\/i> button to change these settings.<\/p>',HGb='<p>Creates a 500 x  300 pixel map viewport centered on Atlanta, GA USA.<\/p>\n<p>Displays a draggable marker and various controls to exercise event handling.<\/p>\n<ul> <li><b>Hide/Show Marker<\/b> button alternately hides and shows the marker.<\/li>\n <li><b>Remove/Add Marker<\/b> button alternately removes and adds the marker to the map.<\/li>\n <li><b>Hide/Show Polyline<\/b> button alternately hides and shows the polyline.<\/li>\n <li><b>Remove/Add Polyline<\/b> button alternately removes and adds the polyline to the map.<\/li>\n <li><b>Hide/Show Polygon<\/b> button alternately hides and shows the polygon.<\/li>\n <li><b>Remove/Add Polygon<\/b> button alternately removes and adds the polygon to the map.<\/li>\n <li><b>Clear Overlays<\/b> Remove all overlays from the map.  <i>Note: after calling this method, the other buttons may be in an invalid state.<\/i><\/li>\n<\/ul>\n<ul>\n <li><b>Show Info Window<\/b> pops up the info window<\/li>\n <li><b>Marker Info Window<\/b> pops up the info window on the marker<\/li>\n <li><b>Add/Remove Map Type<\/b> adds/removes a map type from the map.<\/li>\n <li><b>Clear Table<\/b> Remove all entries from the table below.<\/li>\n <li><b>Add Handler<\/b> Adds an event handler of the type specified in the listbox.  This will create a new entry in the table to monitor and control the handler.<\/li>\n<\/ul><p>Below the action buttons there is a table of all handlers that   have been added.  Each entry contains the following items:<\/p>\n<ul>\n<li><b>ID<\/b> A unique ID for each handler.<\/li>\n<li><b>Type<\/b> The type of handler.<\/li>\n<li><b>Events<\/b> A textbox that shows events as they happen.<\/li><li><b>Clear Text<\/b> A button that clears the <b>Events<\/b> textbox.<\/li><li><b>Remove Handler<\/b> Remove this specific handler instance.  Note: this leaves the entry in place so that you can see that the event no longer fires the handlers.<\/ul>\n',XEb='<p>Creates a 500 x 300 pixel map viewport centered on Atlanta, GA USA.<\/p><p>Type an address in the textbox.  Clicking the \'Go\' button willcontact the Google Geocoding service, display the resulting Lat/Lng coordinates, and re-position the map with those coordinatesin the center <\/p>\n<p>Equivalent to the Maps JavaScript API Example: <a href="http://code.google.com/apis/maps/documentation/examples/geocoding-simple.html">http://code.google.com/apis/maps/documentation/examples/geocoding-simple.html<\/a><\/p>\n',vCb='<p>Creates a 500 x 300 pixel map viewport centered on Palo Alto, CA USA. <\/p>\n<p>Each time the mouse is clicked in this demo, a new marker is placed on the map at the point there the click event occurred.<\/p>',LCb='<p>Creates a 500 x 300 pixel map viewport centered on Palo Alto, CA USA. <\/p><ul>\n<li><b>Hierarchical Control<\/b> A control provided by the API that allows the user to change the map type using a drop down menu of checkboxes.<\/li>\n<li><b>Image Zoom Control<\/b> The standard controls have been replaced with clickable images for zooming in and our or changing the map type from satellite to road map.<\/li><li><b>Text Zoom Control<\/b> The standard zoom in and zoom out controls have been replaced with a custom control in the form of two boxes with the text <i>Zoom In<\/i> and <i>Zoom Out<\/i> at the upper left of the map.<\/li>\n<\/ul>\n<p>See also the Maps JavaScript API Example: <a href="http://code.google.com/apis/maps/documentation/examples/control-custom.html">http://code.google.com/apis/maps/documentation/examples/control-custom.html<\/a><\/p>\n',tCb='<p>Creates a 500 x 300 pixel map viewport centered on Palo Alto, CA USA. You should be able to scroll the viewport by clicking and dragging with the mouse.<\/p>\n<p>After one second, the map will automatically scroll diagonally.<\/p>\n<p>Equivalent to the Maps JavaScript API Example: <a href="http://code.google.com/apis/maps/documentation/examples/map-animate.html">http://code.google.com/apis/maps/documentation/examples/map-animate.html<\/a><\/p>\n',nEb='<p>Creates a 500 x 300 pixel map viewport centered on Palo Alto, CA USA. You should be able to scroll the viewport by clicking and dragging with the mouse.<\/p>\n<p>Dragging the map fires a MapMoveListener that reports the Lat/Lng coordinates below the map.<\/p><p>Equivalent to the Maps JavaScript API Example: <a href="http://code.google.com/apis/maps/documentation/examples/event-context.html">http://code.google.com/apis/maps/documentation/examples/event-context.html<\/a><\/p>\n',hDb='<p>Creates a 500 x 300 pixel map viewport centered on Palo Alto, CA USA. You should be able to scroll the viewport by clicking and dragging with the mouse.<\/p>\n<p>The default mouse cursors have been overridden with crosshairs when hovering over the map, and the text cursor when dragging the map.<\/p><p>Equivalent to the Maps JavaScript API Example: <a href="http://code.google.com/apis/maps/documentation/examples/map-simple.html">http://code.google.com/apis/maps/documentation/examples/map-simple.html<\/a><\/p>\n',xCb='<p>Creates a 500 x 300 pixel map viewport centered on Palo Alto, CA USA. You should be able to scroll the viewport by clicking and dragging with the mouse.<\/p>\n<p>The map window should be decorated with controls for zooming in and out and for changing the map type.<\/p><p>Equivalent to the Maps JavaScript API Example: <a href="http://code.google.com/apis/maps/documentation/examples/control-simple.html">http://code.google.com/apis/maps/documentation/examples/control-simple.html<\/a><\/p>\n',DFb='<p>Creates a 500 x 300 pixel map viewport centered on Palo Alto, CA USA.<\/p><p>Displays a new type of icon (mini marker) at random pointsinside the maps viewport.<\/p>\n<p>Equivalent to the Maps JavaScript API Example: <a href="http://code.google.com/apis/maps/documentation/examples/icon-simple.html">http://code.google.com/apis/maps/documentation/examples/icon-simple.html<\/a><\/p>\n',YJb='<p>Creates a 500 x 300 pixel map viewport centered on Palo Alto, CA USA.<\/p><p>Displays markers at random points.  Clicking on a marker displays an InfoWindow with the number of the marker in the content.<\/p>\n',jDb='<p>Creates a 500 x 300 pixel map viewport centered on Palo Alto, CA USA.<\/p><p>Draws a marker at the center of the maps window.  The marker will move if you click and drag it.<\/p>\n<p>Equivalent to the Maps JavaScript API Example: <a href="http://code.google.com/apis/maps/documentation/examples/marker-drag.html">http://code.google.com/apis/maps/documentation/examples/marker-drag.html<\/a><\/p>\n',_Cb='<p>Creates a 500 x 300 pixel map viewport centered on Palo Alto, CA USA.<\/p><p>Draws a rectangle overlay at the center of the maps window.<\/p>\n<p>Equivalent to the Maps JavaScript API Example: <a href="http://code.google.com/apis/maps/documentation/examples/overlay-custom.html">http://code.google.com/apis/maps/documentation/examples/overlay-custom.html<\/a><\/p>\n',aLb='<p>Creates a 500 x 300 pixel map viewport centered on the default position, where the equator intersects 0 degrees longitude. You should be able to scroll the viewport by clicking and dragging with the mouse.  Zoom in and out by using left and right double clicks.<\/p>\n<p>Equivalent to the Maps JavaScript API Example: <a href="http://code.google.com/apis/maps/documentation/examples/map-simple.html">http://code.google.com/apis/maps/documentation/examples/map-simple.html<\/a><\/p>\n',$Eb='<p>Creates a 500 x 300 pixel map viewport to Demonstrates the Google Bar for search and ads<\/p>',pCb='<p>Creates a 500 x 300 pixel map viewport to Demonstrates the Maps Ads Manager.  Expect to see an ad panel in the lower right of the map<\/p>',BKb='<p>Creates a 500 x 300 pixel map viewport zoomed out to show the entire world.<\/p><p>Click on the map to show the closest municipalities.<\/p>\n',lKb='<p>Creates a 500 x 300 pixel map viewport. You should be able to scroll the viewport by clicking and dragging with the mouse.<\/p>\n<ul><li><b>Display Polygon from an encoded string<\/b> Traces the outline of the Centennial Olympic Park fountain in Atlanta, GA USA.<\/li>\n<li><b>Display Polyline from an encoded string<\/b> Traces a route across a bridge that is 100% opaque.<\/li>\n<li><b>Display Polyline from an encoded string with default transparency<\/b> Similar to the previous demo, but the transparency of the line is set to the default.<\/li><li><b>Display a geodesic Polyline from Zurich to NYC<\/b> A line that follows the curve of the earth.<\/li><li><b>Display a Polyline<\/b> You should see a purple polyline with multiple segments (The vertices are randomly generated).<\/li>\n<li><b>Display ten random Markers<\/b> Ten Markers are placed at random points in the viewport.<\/li><li><b>Load a <a href="http://spreadsheets.google.com/pub?key=p9pdwsai2hDN-cAocTLhnag">Third Party Layer<\/a><\/b><\/ul><p>Equivalent to the Maps JavaScript API Example: <a href="http://code.google.com/apis/maps/documentation/examples/polyline-simple.html">http://code.google.com/apis/maps/documentation/examples/polyline-simple.html<\/a><\/p>\n',xJb='<p>Creates a 500 x 500 pixel map viewport centered on Palo Alto, CA USA. You should be able to scroll the viewport by clicking and dragging with the mouse.<\/p>\n<p>Choose a different item from the drop down menu to see the different map types.<\/p>\n',lEb='<p>Creates a 500 x 500 pixel map viewport centered on the Googleplex in Mountain View, CA USA. Attempts to invoke the Google Earth plugin (not available on all browsers.)<\/p>',eLb='<p>Creates a Street View Panorama and a Map to demonstrate dispatching event between these two objects.<\/p><p>Expect to see a polygon object that represents you Street View point of view on a map. Click on a map to change your location in Street View.<\/p>',MDb='<p>Creates a map centered on Paris, France.<\/p><p>You can create lines or polygons on the map by clicking the <i>Draw New Object<\/i> button. The resulting dialog box allows you to control the properties of the object to draw.You can edit the last line you created by clicking the <i>Edit Polyline<\/i> button, or the last polygon you created by clicking the <i>Edit Polygon<\/i> button.<\/p>',xFb='<p>Creates a map view of the centered on Palo Alto, CA USA<\/p><p>A number of markers are created that share the same shadow, but have different foreground images (letters)<\/p>\n<p>Equivalent to the Maps JavaScript API Example: <a http://code.google.com/apis/maps/documentation/examples/icon-custom.html">http://code.google.com/apis/maps/documentation/examples/icon-custom.html<\/a><\/p>\n',tEb='<p>Creates a map view of the contents of a Geo RSS file<\/p><p>Each entry in the RSS file is displayed as a marker.<\/p>\n<p>Equivalent to the Maps JavaScript API Example: <a href="http://code.google.com/apis/maps/documentation/examples/geoxml-rss.html">http://code.google.com/apis/maps/documentation/examples/geoxml-rss.html<\/a><\/p>\n',jGb='<p>Creates a map view of the contents of a KML file<\/p><p>Displays some paths in a KML file hosted at Google.<\/p>\n<p>Equivalent to the Maps JavaScript API Example: <a href="http://code.google.com/apis/maps/documentation/examples/geoxml-kml.html">http://code.google.com/apis/maps/documentation/examples/geoxml-kml.html<\/a><\/p>\n',bFb='<p>Creates a map viewport centered on Palo Alto, CA USA.<\/p><p>Draws a ground overlay at the center of the maps window with an image of a boot.<\/p>\n',XKb='<p>Displays a map centered on Atlanta, GA USA<\/p> <p>Queries the Google Directions service and displays a polyline, markers on the map, and textual directions on the right.  The directions are for a leisurely route from Midtown Atlanta to the Atlanta Airport through various waypoints.<\/p>\n',hLb='<p>Displays a map centered on Brooklyn, NY USA<\/p><p>The Google Street View service is called and retrieves an overlay representing availabity of Street View data.  Pressing the \'Toggle Street View Overlay\' button will alternately hide and show the overlay.<\/p><p>Equivalent to the Maps JavaScript API Example: <a href="http://code.google.com/apis/maps/documentation/examples/streetview-layer.html">http://code.google.com/apis/maps/documentation/examp
